import React from 'react';
import Aux from '../../hoc/aux';

const layout = (props) => {
    return (
        <Aux>
            <div>Toolbar, sidebar, backdrop</div>
            <main className='Content'>
                {props.children}
            </main>
        </Aux>
    );
}

export default layout;
